import{_ as e,c as t,a,o as b}from"./app.109432a7.js";const u=JSON.parse('{"title":"\uD68C\uC0AC \uB300\uD45C\uD55C\uD14C\uC11C \uAC11\uC9C8 \uB2F9\uD55C \uB0A0","description":"","frontmatter":{"title":"\uD68C\uC0AC \uB300\uD45C\uD55C\uD14C\uC11C \uAC11\uC9C8 \uB2F9\uD55C \uB0A0","createBy":"2022-07-07T00:00:00.000Z"},"headers":[{"level":2,"title":"\uC624\uB298 \uD68C\uC0AC \uB300\uD45C\uD55C\uD14C \uAC11\uC9C8 \uB2F9\uD588\uB2E4.","slug":"\uC624\uB298-\uD68C\uC0AC-\uB300\uD45C\uD55C\uD14C-\uAC11\uC9C8-\uB2F9\uD588\uB2E4"}],"relativePath":"sdhs/2207/220707.md"}'),s={name:"sdhs/2207/220707.md"};function o(n,r,d,i,c,l){return b(),t("div",null,r[0]||(r[0]=[a('<h2 id="\uC624\uB298-\uD68C\uC0AC-\uB300\uD45C\uD55C\uD14C-\uAC11\uC9C8-\uB2F9\uD588\uB2E4" tabindex="-1">\uC624\uB298 \uD68C\uC0AC \uB300\uD45C\uD55C\uD14C \uAC11\uC9C8 \uB2F9\uD588\uB2E4. <a class="header-anchor" href="#\uC624\uB298-\uD68C\uC0AC-\uB300\uD45C\uD55C\uD14C-\uAC11\uC9C8-\uB2F9\uD588\uB2E4" aria-hidden="true">#</a></h2><br> \uC774 \uC774\uC57C\uAE30\uB97C \uD558\uB824\uBA74 \uBA70\uCE60 \uC804\uC73C\uB85C \uB3CC\uC544\uAC00\uC57C \uD55C\uB2E4. <br> \uBA70\uCE60 \uC804\uC5D0 \uD654\uC7A5\uC2E4 \uAC14\uB2E4 \uD68C\uC0AC\uB85C \uB2E4\uC2DC \uB4E4\uC5B4\uC624\uACE0 \uC788\uB294\uB370 \uBCF5\uB3C4\uC5D0\uC11C \uC5B4\uB5A4 \uC544\uC800\uC528\uAC00 \uAC78\uC5B4\uC624\uACE0 \uC788\uC5C8\uC74C. \uADF8\uB0E5 \uC678\uBD80\uC778\uC778 \uC904 \uC54C\uACE0 \uADF8\uB0E5 \uD68C\uC0AC\uB85C \uB4E4\uC5B4\uAC00\uB2C8 \uADF8 \uC544\uC800\uC528\uAC00 \uB530\uB77C \uB4E4\uC5B4\uC624\uBA74\uC11C \uC65C \uC778\uC0AC \uC548 \uD558\uB0D0\uACE0 \uADF8\uB7AC\uB358 \uAC83 \uAC19\uC74C(\uADF8 \uC544\uC800\uC528\uAC00 \uC6B0\uB9AC \uD68C\uC0AC \uB300\uD45C). <br><br> \uADF8\uB7EC\uACE0 1~2\uC77C \uB4A4 \uC810\uC2EC\uC2DC\uAC04\uC774 \uB05D\uB098\uACE0 \uC218\uC11D\uB2D8\uC774 \uB300\uD45C\uB2D8 \uC18C\uAC1C\uD574 \uC8FC\uC2E0\uB2E4\uACE0 \uAC19\uC774 \uB300\uD45C\uC2E4\uB85C \uB4E4\uC5B4\uAC00\uC11C \uC218\uC11D\uB2D8\uC774 \uC18C\uAC1C\uD574 \uC8FC\uC168\uB294\uB370 \uB300\uD45C\uB2D8\uC774 \uB098\uB97C \uBCF4\uACE0 \uADF8\uB54C \uC778\uC0AC \uC548 \uD55C \uC598\uAE30 \uAEBC\uB0B4\uBA74\uC11C \uADF8\uB54C \uAC54\uAC00 \uB098\uC77C\uAC78 \uB9D0\uD588\uC74C(\uADFC\uB370 \uADF8\uB54C\uAC00 \uD68C\uC0AC \uAC00\uB294 \uB9C8\uC9C0\uB9C9 \uC8FC\uC600\uB294\uB370 \uC774\uB54C \uB300\uD45C\uB97C \uC18C\uAC1C \uC2DC\uCF1C\uC8FC\uB294 \uAC83\uB3C4 \uC774\uC0C1\uD588\uC74C). \uADF8\uB7EC\uACE0 \uC549\uC544\uC11C \uB300\uD45C\uB2D8\uACFC \uC598\uAE30\uAC00 \uC2DC\uC791\uB42C\uB294\uB370 \uB0B4\uC6A9\uC774 \uC9C0\uAE08\uAE4C\uC9C0 \uBD80\uBAA8\uB2D8\uD55C\uD14C \uBC1B\uC73C\uBA74\uC11C \uC790\uB790\uC73C\uB2C8 \uC774\uC81C \uB124\uAC00 \uC6B0\uB9AC \uD68C\uC0AC \uB4E4\uC5B4\uC640\uC11C \uBCA0\uD480\uB77C\uACE0 \uADF8\uB7FC \uADF8\uB7EC\uACE0 \uAC19\uC774 \uB4E4\uC5B4\uC640\uC11C \uC549\uC544\uACC4\uC2E0 \uC218\uC11D\uB2D8\uD55C\uD14C \uC774\uC81C\uBD80\uD130 \uD68C\uC0AC \uC0DD\uD65C\uD558\uBA74\uC11C \uBAA8\uB974\uB294\uAC70 \uC788\uC73C\uBA74 \uC218\uC11D\uB2D8\uD55C\uD14C \uBB3C\uC5B4\uBCF4\uACE0 \uC544\uBC84\uC9C0\uB77C\uACE0 \uC0DD\uAC01\uD558\uB77C\uACE0 \uB9D0\uD568(\uC774\uB54C \uAC00\uC871 \uC598\uAE30 \uC880 \uAEBC\uB0B4\uC11C \uAE30\uBD84\uC774 \uC548 \uC88B\uC558\uC74C). <br><br> \uADF8\uB7EC\uBA74\uC11C \uC598\uAE30\uD558\uB294 \uC911\uAC04\uC911\uAC04\uC5D0 \uC778\uC0AC \uC548 \uD55C \uC598\uAE30 \uC790\uAFB8 \uAEBC\uB0B4\uBA74\uC11C \uC778\uC0AC \uB611\uBC14\uB85C \uD558\uACE0 \uB2E4\uB2C8\uB77C\uACE0 \uD558\uACE0 \uD68C\uC0AC \uC120\uBC30(\uD68C\uC0AC \uB3D9\uB8CC\uBD84\uB4E4)\uB2D8\uB4E4\uC774 \uC788\uACE0 \uB124\uAC00 \uB9C9\uB0B4\uB2C8\uAE4C 30\uBD84 \uC77C\uCC0D \uCD9C\uADFC\uD558\uACE0 \uB2A6\uAC8C \uD1F4\uADFC\uD558\uB77C\uACE0 \uAC15\uC694\uD568(...). \uADF8\uB54C\uB294 \uB300\uD45C\uB2D8 \uCC98\uC74C \uB9CC\uB098\uACE0 \uD559\uC0DD\uACFC \uD68C\uC0AC \uB300\uD45C\uC5D0 \uC785\uC7A5\uC774\uB2C8\uAE4C \uADF8\uB0E5 \uB300\uB2F5\uB9CC \uD558\uACE0 \uB05D\uB0A8. <br><br> \uADF8\uB54C\uBD80\uD130 \uB0B4\uAC00 \uB300\uD45C\uB2D8\uD55C\uD14C \uC778\uC0AC\uD558\uBA74 &quot;\uC5B4? \uC5B4! \uADF8\uB807\uC9C0 \uADF8\uB807\uAC8C \uC778\uC0AC\uD558\uB294 \uAC70\uC57C&quot; \uC774\uB7F0 \uC2DD\uC73C\uB85C \uB9C9 \uB0A0 \uC778\uC0AC\uB3C4 \uC81C\uB300\uB85C \uC548 \uD558\uB294 \uC0AC\uB78C\uC774\uC5C8\uB358\uAC83 \uB9C8\uB0E5 \uC8FC\uC758 \uC0AC\uB78C\uB4E4 \uB2E4 \uB4E3\uAC8C \uC77C\uBD80\uB7EC \uD06C\uAC8C \uB9D0\uD558\uBA74\uC11C \uB098\uD55C\uD14C \uC218\uCE58\uC2EC\uC744 \uC92C\uC74C(\uC77C\uBD80\uB7EC \uADF8\uB7EC\uB294 \uAC83 \uAC19\uC74C). <br><br> \uC624\uB298 2\uC2DC\uC5D0 \uAD50\uC721\uBC1B\uC73C\uB7EC \uAD50\uC721\uC2E4\uB85C \uB4E4\uC5B4\uAC00\uACE0 \uC788\uC5C8\uB294\uB370 \uCD9C\uADFC\uD558\uB358 \uB300\uD45C\uB2D8\uC744 \uB9CC\uB098\uC11C \uC778\uC0AC\uB97C \uD568(\uC774\uB54C\uB3C4 \uB611\uAC19\uC774 \uD589\uB3D9\uD588\uC74C). \uAD50\uC721\uC2E4 \uB4E4\uC5B4\uAC00\uB824\uACE0 \uD558\uB2C8\uAE4C \uB300\uD45C\uB2D8\uC774 \uC5B4\uB514 \uAC00\uB0D0\uACE0 \uB098\uD55C\uD14C \uBB3C\uC5B4\uBCF4\uACE0 \uB0B4\uAC00 \uAD50\uC721 \uBC1B\uC73C\uB7EC \uAD50\uC721\uC2E4 \uB4E4\uC5B4\uAC04\uB2E4\uACE0 \uD558\uACE0 \uB4E4\uC5B4\uC624\uB2C8 \uB300\uD45C\uB2D8\uB3C4 \uAC19\uC774 \uB4E4\uC5B4\uC634. <br><br> \uADF8\uB7EC\uACE0\uB294 \uB0B4\uAC00 \uB4E4\uACE0\uC788\uB294 \uBB3C\uC744 \uBCF4\uB354\uB2C8 \uB108\uB9CC \uC65C \uBB3C\uC744 \uBA39\uB0D0 \uAD50\uC721\uD574\uC8FC\uC2DC\uB294 \uBD84 \uBB3C\uB3C4 \uB2F9\uC5F0\uD788 \uB124\uAC00 \uAC00\uC11C \uB5A0\uC624\uB294 \uAC70\uB77C\uACE0 \uD558\uC2EC. \uADF8\uB7EC\uACE0 \uB124\uAC00 \uBA39\uB294 \uBB3C\uC774\uB098 \uCEF5, \uC6D4\uAE09, \uAD50\uC721\uD574\uC8FC\uC2DC\uB294 \uBD84 \uC2DC\uAC04\uAE4C\uC9C0 \uC804\uBD80 \uD68C\uC0AC\uAC00 \uB124 \uC6D4\uAE09\uC758 \uC138\uBC30, \uB9E4\uB2EC 1,000\uB9CC \uC6D0 \uC815\uB3C4\uB97C \uB108\uD55C\uD14C \uC3DF\uC544 \uBD93\uB294\uAC70\uB77C\uBA74\uC11C \uB098\uD55C\uD14C \uAC11\uC9C8\uD568. \uADF8\uB7EC\uACE0 \uAD50\uC721\uC2E4\uC5D0 \uB108\uC800\uBD84\uD558\uAC8C \uB193\uC5EC \uC788\uB294 \uBA40\uD2F0\uD0ED\uC744 \uBCF4\uB354\uB2C8 \uBA40\uD2F0\uD0ED\uC744 \uAC00\uB974\uD0A4\uBA74\uC11C \uB098\uD55C\uD14C &quot;\uB354\uB835\uB0D0? \uC548 \uB354\uB835\uB0D0?&quot; \uB9D0\uD558\uBA74\uC11C \uC774\uB7F0 \uAC74 \uB2E4 \uB9C9\uB0B4\uAC00 \uCE58\uC6B0\uB294 \uAC70\uB77C\uACE0 \uD558\uBA74\uC11C \uB098\uD55C\uD14C \uBA40\uD2F0\uD0ED \uC815\uB9AC \uD574\uB193\uC744\uB77C\uACE0\uB3C4 \uD568. <br><br> \uC774\uB54C \uB0B4\uAC00 \uAC11\uC790\uAE30 \uAC11\uC9C8 \uB2F9\uD558\uB294\uAC8C \uB2F9\uD669\uC2A4\uB7EC\uC6CC\uC11C \uB300\uD45C\uB2D8 \uB9D0\uC5D0\uB3C4 \uB300\uB2F5 \uC798 \uBABB\uD558\uACE0 \uB208\uB3C4 \uC798 \uBABB \uB9C8\uC8FC\uCE58\uB2C8\uAE4C \uC774\uAC74 \uB2E4 \uB108\uB97C \uC704\uD574\uC11C \uD558\uB294 \uB9D0\uC774\uB77C\uACE0 \uADF8\uB7EC\uBA74\uC11C 2~3\uAC1C\uC6D4 \uB3D9\uC548 \uB354 \uB108\uB97C \uC9C0\uCF1C\uBCF4\uACE0 \uB9C8\uC74C\uC5D0 \uC548 \uB4E4\uBA74 \uB0B4\uAC00 \uB108\uB97C \uC790\uB97C \uC218\uB3C4 \uC788\uB2E4\uACE0\uB3C4 \uD558\uACE0 \uC790\uAE30 \uB9D0\uC5D0 \uAE30\uBD84\uC774 \uB098\uC05C \uAC70\uB77C\uBA74 \uD68C\uC0AC\uB791 \uB098(\uC900\uC6B0)\uD55C\uD14C \uC11C\uB85C \uD53C\uD574\uC8FC\uB294 \uAC70\uB77C\uBA74\uC11C \uB098\uBCF4\uACE0 \uC54C\uC544\uC11C \uB098\uAC00\uB77C\uACE0 \uD568. <br><br> \uC774\uB54C \uB0B4\uAC00 \uD559\uC0DD\uC778 \uC2E0\uBD84\uC774\uACE0 \uB3C4\uC81C \uACFC\uC815\uC73C\uB85C \uD68C\uC0AC\uC5D0 \uB4E4\uC5B4\uC628\uAC70\uB77C\uC11C \uBCC4 \uB9D0\uB300\uAFB8\uB3C4 \uC548\uD558\uACE0 \uC54C\uACA0\uB2E4\uACE0 \uB300\uB2F5\uB9CC\uD558\uACE0 \uB118\uC5B4\uAC14\uC74C <br><br> \uAD50\uC721 \uBC1B\uB294 \uC911\uC5D0 \uC120\uC0DD\uB2D8\uB4E4\uACFC 2\uD559\uB144 \uC598 \uACC4\uC57D\uC11C \uC4F0\uB7EC \uC624\uC2EC. \uC26C\uB294\uC2DC\uAC04\uC5D0 \uC324\uC774 \uBD80\uB974\uC154\uC11C \uBC29 \uC548\uC5D0 \uB4E4\uC5B4\uAC00\uC11C \uC598\uAE30\uB97C \uD588\uB294\uB370 \uC774\uB54C\uB294 \uC774\uBBF8 2\uD559\uB144 \uACC4\uC57D\uC11C\uC5D0 \uB3C4\uC7A5\uC774 \uB2E4 \uCC0D\uD600\uC788\uC5C8\uC74C. <br><br> \uB2E4\uC74C\uC8FC \uC6D4\uC694\uC77C\uB0A0 \uD559\uAD50 \uAC00\uC11C \uC324\uD55C\uD14C \uB9D0\uD574\uC57C \uACA0\uC74C. <br><br><br><br>',36)]))}var _=e(s,[["render",o]]);export{u as __pageData,_ as default};
